import logo from './logo.svg';
import './App.css';
import Planet from '../Components/Planet'; 
function App() {
  return (
    <div className="App">
      <h1>Cosmos Oddysey</h1>
      <p>Select your origin and destination planets!</p>
      <Planet planet="Mercury" />
      <Planet planet="Venus" />
      <Planet planet="Earth" />
      <Planet planet="Mars" />
      <Planet planet="Jupiter" />
      <Planet planet="Saturn" />
      <Planet planet="Uranus" />
      <Planet planet="Neptune" />
    </div>
  );
}

export default App;
